INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 0, "あたしだって\nやるときはやるよ！", "リン", 24, 1, 1, 0.0, 24001, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", 24, 1, 1, 0.0, 24002, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 2, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", 24, 1, 1, 0.0, 24003, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 3, "やったね！\nこれでようやく\nサボれるよ…", "リン", 24, 2, 2, 0.0, 24004, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", 24, 1, 1, 0.0, 24005, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", 24, 2, 2, 0.0, 24006, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 6, "あたしも意外と\nやるもんでしょ？", "リン", 24, 2, 2, 0.0, 24007, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", 24, 4, 4, 0.0, 24008, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", 24, 4, 4, 0.0, 24009, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 9, "まじめに\nやったんだけどな…\n悔しいな～", "リン", 24, 4, 4, 0.0, 24010, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10, "やられた…\nねずみって意外と\nてごわいね", "リン", 24, 4, 4, 0.0, 24011, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", 24, 4, 4, 0.0, 24012, 102601, 10040, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1.81, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 12, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", 24, 1, 4, 0.0, 24013, 102601, 10040, 0.0);
